w.x:
var $bm_rt;
var s = content('Anchor').transform.scale[0];
if (s == 0)
    $bm_rt = 0;
else
    $bm_rt = $bm_div(100, s);

s.x:
var $bm_rt;
var flip = effect('Controller')(5).value;
flip ? flip = -1 : flip = 1;
$bm_rt = [
    flip * effect('Controller')(4) * 2,
    effect('Controller')(4) * 2
];

ks.x:
var $bm_rt;
if (active) {
    var fx = effect('IK | right hand b');
    var layer1 = null;
    var result = [[
            0,
            0
        ]];
    if (fx(1).value && fx(12).value) {
        try {
            layer1 = fx(9);
        } catch (e) {
        }
        if (layer1 != null) {
            var l = layer1.toWorld(layer1.anchorPoint);
            l = fromWorld(l);
            result = [
                l,
                [
                    0,
                    0
                ]
            ];
        }
    }
    $bm_rt = createPath(result, [], [], false);
} else
    $bm_rt = value;

